/*Table structure for table `t_airshuttle_book_driver_process` */

DROP TABLE IF EXISTS `t_airshuttle_book_driver_process`;

CREATE TABLE `t_airshuttle_book_driver_process` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `book_driver_id` int(11) DEFAULT NULL COMMENT '用户预约司机表id',
  `review_process_id` int(11) DEFAULT NULL COMMENT '审核流程定义表id（预约流程：0:等待确认报价，1:报价成功，2:报价失败）',
  `process_result_desc` varchar(500) DEFAULT NULL COMMENT '流程回执结果',
  `create_time` datetime DEFAULT NULL,
  `MODIFY_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='预约司机流程表';

