/*Table structure for table `t_airshuttle_book_flights` */

DROP TABLE IF EXISTS `t_airshuttle_book_flights`;

CREATE TABLE `t_airshuttle_book_flights` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `depart_time` datetime DEFAULT NULL COMMENT '出发时间',
  `arrive_time` datetime DEFAULT NULL COMMENT '到达时间',
  `airlines` varchar(500) DEFAULT NULL COMMENT '航空公司',
  `flight` varchar(100) DEFAULT NULL COMMENT '航班班次',
  `depart_airport` varchar(100) DEFAULT NULL COMMENT '出发机场',
  `arrive_airport` varchar(100) DEFAULT NULL COMMENT '到达机场',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='预定航班表';

/*Data for the table `t_airshuttle_book_flights` */

/*Table structure for table `t_airshuttle_car` */

DROP TABLE IF EXISTS `t_airshuttle_car`;

CREATE TABLE `t_airshuttle_car` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `CREATE_PERSON` int(11) DEFAULT NULL COMMENT '创建人',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `MODIFY_PERSON` int(11) DEFAULT NULL COMMENT '修改人',
  `MODIFY_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `car_number` varchar(50) DEFAULT NULL COMMENT '车牌号',
  `car_brand` varchar(50) DEFAULT NULL COMMENT '车辆品牌',
  `car_Model` varchar(50) DEFAULT NULL COMMENT '车辆型号',
  `car_colour` varchar(50) DEFAULT NULL COMMENT '车身颜色',
  `car_seatNum` int(11) DEFAULT NULL COMMENT '座位数',
  `car_picture_url` varchar(100) DEFAULT NULL COMMENT '车辆照片路径',
  `status` int(11) DEFAULT NULL COMMENT '司机认证状态',
  `status_msg` varchar(500) DEFAULT NULL COMMENT '认证消息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='车辆表';

