/*Table structure for table `t_airshuttle_complaint_box` */

DROP TABLE IF EXISTS `t_airshuttle_complaint_box`;

CREATE TABLE `t_airshuttle_complaint_box` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `CREATE_PERSON` int(11) DEFAULT NULL COMMENT '创建人',
  `complaint` varchar(500) DEFAULT NULL COMMENT '意见反馈内容',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `MODIFY_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `parent_id` int(11) DEFAULT NULL COMMENT '引用id,回复意见反馈',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='意见反馈';

