/*Table structure for table `t_airshuttle_driver` */

DROP TABLE IF EXISTS `t_airshuttle_driver`;

CREATE TABLE `t_airshuttle_driver` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `CREATE_PERSON` int(11) DEFAULT NULL COMMENT '创建人',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `MODIFY_PERSON` int(11) DEFAULT NULL COMMENT '修改人',
  `MODIFY_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `DESCRIPTION` varchar(500) DEFAULT NULL COMMENT '描述',
