/*Table structure for table `t_airshuttle_driver_car` */

DROP TABLE IF EXISTS `t_airshuttle_driver_car`;

CREATE TABLE `t_airshuttle_driver_car` (
  `driver_id` int(11) DEFAULT NULL COMMENT '司机编号',
  `car_id` int(11) DEFAULT NULL COMMENT '车辆编号',
  `MODIFY_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='司机车辆关联表';

/*Data for the table `t_airshuttle_driver_car` */

/*Table structure for table `t_airshuttle_enterprise` */

DROP TABLE IF EXISTS `t_airshuttle_enterprise`;

CREATE TABLE `t_airshuttle_enterprise` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `CREATE_PERSON` int(11) DEFAULT NULL,
  `CREATE_TIME` datetime DEFAULT NULL,
  `MODIFY_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `DESCRIPTION` varchar(500) DEFAULT NULL COMMENT '企业描述',
  `name` varchar(100) DEFAULT NULL COMMENT '企业名称',
  `business_license_url` varchar(100) DEFAULT NULL COMMENT '营业执照',
  `telephone` varchar(50) DEFAULT NULL COMMENT '企业手机号码',
  `USERNAME` varchar(50) DEFAULT NULL COMMENT '用户名',
  `EMAIL` varchar(50) DEFAULT NULL COMMENT '邮件地址',
  `photot_url` varchar(100) DEFAULT NULL COMMENT '头像地址',
  `security_money` decimal(10,0) DEFAULT NULL COMMENT '保证金',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='企业信息表';

/*Data for the table `t_airshuttle_enterprise` */

/*Table structure for table `t_airshuttle_enterprise_driver` */

DROP TABLE IF EXISTS `t_airshuttle_enterprise_driver`;

CREATE TABLE `t_airshuttle_enterprise_driver` (
  `enterprise_id` int(11) DEFAULT NULL COMMENT '企业编号',
  `driver_id` int(11) DEFAULT NULL COMMENT '司机编号'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='企业司机关联表';

/*Data for the table `t_airshuttle_enterprise_driver` */

/*Table structure for table `t_airshuttle_fly_group` */

DROP TABLE IF EXISTS `t_airshuttle_fly_group`;

CREATE TABLE `t_airshuttle_fly_group` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `Designation_number` varchar(100) DEFAULT NULL COMMENT '番号',
  `CREATE_PERSON` int(11) DEFAULT NULL,
  `CREATE_TIME` datetime DEFAULT NULL,
  `MODIFY_PERSON` int(11) DEFAULT NULL,
  `MODIFY_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `Admission_school` varchar(100) DEFAULT NULL COMMENT '录取学校',
  `group_type` int(11) DEFAULT NULL COMMENT '飞友团类型',
  `origin` varchar(100) DEFAULT NULL COMMENT '出发地',
  `destination` varchar(100) DEFAULT NULL COMMENT '目的地',
  `group_name` varchar(50) DEFAULT NULL COMMENT '飞友团名称',
  `max_member` int(11) DEFAULT NULL COMMENT '人数上限',
  `expiration_date` datetime DEFAULT NULL COMMENT '截止日期',
  `contact_information` varchar(100) DEFAULT NULL COMMENT '联系方式',
  `memo` varchar(500) DEFAULT NULL COMMENT '备注',
  `is_Book_flights` int(11) DEFAULT NULL COMMENT '是否预定机票(0:没有预定，1：预定)',
  `book_flights_id` int(11) DEFAULT NULL COMMENT '预定航班信息(t_airshuttle_book_flights)',
  `depart_time` datetime DEFAULT NULL COMMENT '出发时间',
  `arrive_time` datetime DEFAULT NULL COMMENT '到达时间',
  `airlines` varchar(500) DEFAULT NULL COMMENT '航空公司',
  `flight` varchar(100) DEFAULT NULL COMMENT '航班班次',
  `depart_airport` varchar(100) DEFAULT NULL COMMENT '出发机场',
  `arrive_airport` varchar(100) DEFAULT NULL COMMENT '到达机场',
  `is_book_pick_up_airport` int(11) DEFAULT NULL COMMENT '是否预约接机(0:没有预定，1：预定)',
  `book_car_number` int(11) DEFAULT NULL COMMENT '预约接机车辆数量',
  `carry_number_person` int(11) DEFAULT NULL COMMENT '预约接机可载人数',
  `driver_list` varchar(100) DEFAULT NULL COMMENT '预约接机司机列表',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='飞友团';

/*Data for the table `t_airshuttle_fly_group` */

/*Table structure for table `t_airshuttle_group_type` */

DROP TABLE IF EXISTS `t_airshuttle_group_type`;

CREATE TABLE `t_airshuttle_group_type` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` int(11) DEFAULT NULL COMMENT '团类型（0:飞友团，1:室友团）',
  `desc` varchar(100) DEFAULT NULL COMMENT '描述',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='飞友团，室友团，团类型：姐妹团等等';

/*Data for the table `t_airshuttle_group_type` */

/*Table structure for table `t_airshuttle_house_group` */

DROP TABLE IF EXISTS `t_airshuttle_house_group`;

CREATE TABLE `t_airshuttle_house_group` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `Designation_number` varchar(100) DEFAULT NULL COMMENT '番号',
  `CREATE_PERSON` int(11) DEFAULT NULL,
  `MODIFY_PERSON` int(11) DEFAULT NULL,
  `MODIFY_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `CREATE_TIME` datetime DEFAULT NULL,
  `house_type` int(11) DEFAULT NULL COMMENT '室友团类型',
  `Admission_school` varchar(100) DEFAULT NULL COMMENT '录取学校',
  `house_group_name` varchar(100) DEFAULT NULL COMMENT '室友团名称',
  `dorm_leader` varchar(50) DEFAULT NULL COMMENT '寝室长',
  `max_member` int(11) DEFAULT NULL COMMENT '人数上限',
  `geographic_require` varchar(100) DEFAULT NULL COMMENT '地理要求',
  `Monthly_scope` varchar(100) DEFAULT NULL COMMENT '月租范围',
  `expiration_date` datetime DEFAULT NULL COMMENT '截止日期',
  `contact_information` varchar(100) DEFAULT NULL COMMENT '联系方式',
  `is_rent_house` int(11) DEFAULT NULL COMMENT '是否已有租赁房屋（0:没有,1:有）',
  `community_name` varchar(100) DEFAULT NULL COMMENT '小区名字',
  `geographic_area` varchar(100) DEFAULT NULL COMMENT '地址位置',
  `Door_model` varchar(100) DEFAULT NULL COMMENT '户型信息',
  `live_number_person` int(11) DEFAULT NULL COMMENT '可住人数',
  `Monthly_price` varchar(100) DEFAULT NULL COMMENT '月租价格',
  `rent_house_memo` varchar(500) DEFAULT NULL COMMENT '租赁房屋备注信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='室友团';

/*Data for the table `t_airshuttle_house_group` */

/*Table structure for table `t_airshuttle_my_collection` */

DROP TABLE IF EXISTS `t_airshuttle_my_collection`;

CREATE TABLE `t_airshuttle_my_collection` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `ref_id` int(11) DEFAULT NULL COMMENT '引用飞友团，室友团等主键编号',
  `type` int(11) DEFAULT NULL COMMENT '类型(1:飞友团，2:室友团，3:司机)',
  `user_id` int(11) DEFAULT NULL COMMENT '用户编号',
  `CREATE_TIME` datetime DEFAULT NULL,
  `MODIFY_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='我的收藏表';

/*Data for the table `t_airshuttle_my_collection` */

/*Table structure for table `t_airshuttle_order` */

DROP TABLE IF EXISTS `t_airshuttle_order`;

/*jimmy add Designation_number for t_airshuttle_order   */
CREATE TABLE `t_airshuttle_order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
`Designation_number` varchar(100) DEFAULT NULL COMMENT '番号',
  `create_time` datetime DEFAULT NULL,
  `MODIFY_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `user_id` int(11) DEFAULT NULL COMMENT '用户编号',
  `driver_id` int(11) DEFAULT NULL COMMENT '司机编号',
  `reception_air_id` int(11) DEFAULT NULL COMMENT '接机表id(t_airshuttle_reception_air)',
  `book_number_person` int(11) DEFAULT NULL COMMENT '预约人数',
  `pick_up_time` datetime DEFAULT NULL COMMENT '接机时间',
  `book_price` varchar(50) DEFAULT NULL COMMENT '预约价格',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单表';

/*Data for the table `t_airshuttle_order` */

/*Table structure for table `t_airshuttle_order_evaluate` */

DROP TABLE IF EXISTS `t_airshuttle_order_evaluate`;

CREATE TABLE `t_airshuttle_order_evaluate` (
  `id` int(11) DEFAULT NULL,
  `parent_id` int(11) DEFAULT NULL COMMENT '引用父编号',
  `order_id` int(11) DEFAULT NULL COMMENT '订单编号',
  `content` varchar(500) DEFAULT NULL COMMENT '评价内容'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单评价表';

/*Data for the table `t_airshuttle_order_evaluate` */

/*Table structure for table `t_airshuttle_order_process` */

DROP TABLE IF EXISTS `t_airshuttle_order_process`;

CREATE TABLE `t_airshuttle_order_process` (
 `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(11) DEFAULT NULL COMMENT '订单编号',
  `review_process_id` int(11) DEFAULT NULL COMMENT '审核流程定义表id(1:支付成功，2:支付失败，3:完成接机，4:申请退款，5:退款成功，6:拒绝退款)',
  `process_result_desc` varchar(500) DEFAULT NULL COMMENT '流程回执结果',
  `create_time` datetime DEFAULT NULL,
  `MODIFY_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单流程表';

/*Data for the table `t_airshuttle_order_process` */

/*Table structure for table `t_airshuttle_reception_air` */

DROP TABLE IF EXISTS `t_airshuttle_reception_air`;

CREATE TABLE `t_airshuttle_reception_air` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `CREATE_PERSON` int(11) DEFAULT NULL,
  `CREATE_TIME` datetime DEFAULT NULL,
  `MODIFY_PERSON` int(11) DEFAULT NULL,
  `MODIFY_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `reception_city` varchar(50) DEFAULT NULL COMMENT '目标城市',
  `reception_school` varchar(50) DEFAULT NULL COMMENT '目标学校',
  `reception_airport` varchar(50) DEFAULT NULL COMMENT '目标机场',
  `driver_id` int(11) DEFAULT NULL COMMENT '司机编号',
